/*

This is an engine for Telegram bots to make an automated process of saving to PNG any telegram stickerpacks. With this you can save any of your favorite stickers in much shorter time than if you try to do in one by one via "Save as" menu in TG.

To use this script you need:
1) Working Telegram account;
2) Valid telegram Bot token;
3) Modern desktop browser with HTML5 and stuff.

Assume you already have a TG account. Then login.

If you DON'T have a bot yet, follow these instructions:
1) Open a dialog with @BotFather and send "/start" command.
2) Send a "/newbot" command and type a name (aka First Name) for a bot. If this will be only your private bot, you can name it like "Username's bot", for example.
3) Send a user name (aka @name) for your bot. It must be unique (among all other public bots) and end in "bot", for example "username_bot".
4) You will receive a token (HTTP API key) for your bot. Also you may proceed to other bot options.

To start saving stickers, open your browser. Navigate to URL:
https://api.telegram.org/404
You must see some JSON formatted text.

Open your browser's javascript console. Ctrl+Shift+K / Ctrl+Shift+J / F12…
Paste there THIS WHOLE FILE as text.
Yes. Then press Enter. You can clear the console if it became laggy.

You will see a page with a text field named "Your bot token:". So, paste there your bot token.
Then press (single click) "Start!" button to the right.

Careful, do not press anything twice!

If network is OK, you will see "Bot: ..." string appeared below.
At the right side there will be a log of operations. You can close browser's console, if you tired to read all that network requests ))

DON'T FORGET:
Now you have to send your bot token to the bot itself, via Telegram as a normal private message. This ensures that it will answer only your requests.
The bot then should reply "OK" to your message with token.

Finally, to save some stickerpacks all you need is to send/forward to your bot any sticker.
If the sticker belongs to a stickerpack, the bot will download all corresponding stickers, convert to .png and then ZIP everything (both originals and PNGs) into one archive.
If this is a "lone sticker" (sent as .webp file, but rendered as a sticker in TG), it will be just downloaded, converted and zipped (2 files in archive).

Note that PNG is larger than WEBP, so your bot downloaded actually much less data than resulting file size (later you can measure only .webp sizes if you want).

Files are stored to IndexedDB, local in-browser database. To save them to your disk, you need to click corresponding link (Blob URL) that appears in the page when archive is done.
(Some browsers may give you a wrong filename, so copy the title before clicking).

You can send as much stickers as you want, but with very big packs your browser can run out of memory and crash...

To save all already downloaded packs at once, you can click "save all" link (second link in page). Please, click it only once, and wait for new entry to appear. This will be a temporary archive (not stored in database) that contains all your other archives. Just click it and save!

When you reload the page next time, you have to paste this script to browser's console again, and put your bot token (and also send it to the bot).
But if you already have some archives in local database, they will be listed for you to save. Note that if you send a sticker from a pack that already been downloaded - then it will be downloaded, converted and archived again (possibly replacing old entry in database).

To clear all local archives from your browser, click the first link in the page ("delete all" / "recreate database"). Wait until the page refreshes, and you will need to repeat console pasting, token sending, etc.

This script is specially meant for "personal" usage, and you should not run a "sticker saving bot" in production that way. Because in browser it takes too much CPU time to convert and zip arbitrary stickers (so it will be trivial to hang your system by feeding bot with large packs).
 
Tested by me in Firefox 19 and Chrome 38.

The following code is mine, and license is WTFPL.
But down here there will be other libraries that I used. Of course, they're not mine, and license is different.

Follow "//" comments:

*/


setTimeout(function(){
var token,host,botapi,fileapi,customauth,_bot_;

function zipfiles(arr,done){
zip.createWriter(new zip.BlobWriter(), function(w){
var i=arr.length;
function n(){
if(--i<0)return w.close(done);
w.add(arr[i][0],new zip.BlobReader(arr[i][1]),function(){setTimeout(n,0);});
};
n();
});
}

function log_init(){
document.body.innerHTML='<style>p{margin:8px;}xmp{display:inline;}</style>';
log_init.div=document.createElement('div');
document.body.appendChild(log_init.div);
log_init.log=document.createElement('textarea');
var s=log_init.log.style;
s.position='fixed';
s.top='0';
s.right='0';
s.height='100%';
s.width='256px';
document.body.appendChild(log_init.log);
}

function log_write(line){
log_init.log.value+='* '+line+'\n';
log_init.log.selectionStart=log_init.log.selectionEnd=log_init.log.value.length;
}

function log_data(html){
var p=document.createElement('p');
p.innerHTML=html;
log_init.div.appendChild(p);
}

function GetUrl(url,done,asblob,formdata){
var t=function(){
console.log('ERROR! "'+url+'"');
log_write('XMLHttpRequest FAIL');};
var x=new XMLHttpRequest();
x.ontimeout=t;
x.onerror=t;
x.onabort=t;
x.open(formdata?'POST':'GET',url,true);
x.responseType=asblob?'blob':'text';
x.onreadystatechange=function(){
if(+x.readyState===4){
if(+x.status===200)done(x.response||x.responseText);
else t();
}};x.send(formdata||null);};

function Call(func,args,cb){
console.log(func,args);
var req=botapi+func+'?';
args=args||{};
for(var k in args){req+=encodeURIComponent(k)+'='+encodeURIComponent(args[k])+'&';}
return GetUrl(req,function(str){str=JSON.parse(str);
if(str.ok)cb(str.result);
else{
console.log('Api error: ',str);
log_write('Api FAIL');
}
});
}

function Status(text,cb){
document.title=text;
return Call('editMessageText',{chat_id:Status.Chat,message_id:Status.Msg,text:text,parse_mode:'Markdown'},cb);
}

function Reply(text,msg,chat,cb){
document.title=text;
return Call('sendMessage',{chat_id:chat,text:text,reply_to_message_id:msg,parse_mode:'Markdown'},function(m){
Status.Chat=chat;
Status.Msg=m.message_id;
return cb();
});
}

function Log(){console.log(arguments);return null;};

function GetUpdates(poll){
var limit=20;
var timeout=15;
var local=_bot_+'_updatesoffset';
var offset=+(localStorage[local]||0);
Call('getUpdates',{offset:offset,limit:limit,timeout:timeout,allowed_updates:'[]'},function(upd){
var arr=[],wrong=0;
upd.forEach(function(u){
if(u.update_id>=offset)offset=u.update_id+1;
if(!GetUpdates.auth&&u.message&&u.message.text&&u.message.text.indexOf(token)>=0){
Call('sendMessage',{chat_id:u.message.chat.id,text:'OK',reply_to_message_id:u.message.message_id},function(){
GetUpdates.auth=u.message.chat.id;
log_write('Auth token OK');
log_data('== Bot is OK! ==');
});
}else{
if(u.message&&GetUpdates.auth==u.message.chat.id&&u.message.sticker)arr.push(u.message);
else wrong++;
}
});
localStorage[local]=''+offset;
if(wrong>0)log_write('Ignoring: '+wrong);
if(arr.length>0)log_write('Processing: '+arr.length);
poll(arr);
});

}

function StikerLoop(stick){
if(StikerLoop.lock)return log_write('Secondary call dropped');
var next=function(){
log_write('Poll...');
document.title='Ready';
StikerLoop.lock=true;
GetUpdates(function(msg){
StikerLoop.lock=false;
stick(msg,function(){
setTimeout(next,1000);
});});
}
next();
}

function DownloadMedia(id,done){
Call('getFile',{file_id:id},function(res){
GetUrl(fileapi+res.file_path,function(blob){
done(blob);
},true);
});
}

function db_init(cb){
GetByKey(null,function(arr){
var s='';
try{
arr.forEach(function(obj){
s+='<a target="_blank" download="'+obj.key+'" href="'+URL.createObjectURL(obj.blob)+'">'+obj.key+'</a><br>';
});
}catch(e){s='';};
if(s!=''){
s='<u>Local files:</u> [<a href="#" id="deleteall"><i>delete all and exit</i></a>]<br><br>'+s+'<br>[<a href="#" id="saveall"><i>save all (new too)</i></a>]';
log_data(s);
}else{
log_data('<i>No local files found</i> [<a href="#" id="deleteall"><i>recreate database and reload</i></a>]<br><br>[<a href="#" id="saveall"><i>save all new</i></a>]');
}
document.getElementById('saveall').onclick=function(){
GetByKey(null,function(arr){
arr=arr.map(function(obj){return [obj.key,obj.blob];});
if(arr&&arr.length>0){
zipfiles(arr,function(z){
var zipname='stickers_'+arr.length+'_'+(Date.now())+'.zip';
log_data('<a target="_blank" download="'+zipname+'" href="'+URL.createObjectURL(z)+'">'+zipname+'</a>');
});
}
});
};
document.getElementById('deleteall').onclick=function(){
DatabaseClear(function(){
document.location.reload();
});
};
return cb();
});
}

function db_put(blob,name,cb){
var obj={key:name,blob:blob};
try{
PutToTable([obj],function(){
log_data('<a target="_blank" download="'+name+'" href="'+URL.createObjectURL(blob)+'">'+name+'</a>');
return cb();
});
}catch(e){
console.log('Database erorr:',e);
log_write('Database FAIL!');
log_data('<b>IndexedDB failed, try to clear/recreate</b>');
}
}
var tgsavestackerpacks='tgsavestackerpacks';
function DatabaseConnect(Done){
var Idb=window.indexedDB||window.mozIndexedDB||window.webkitIndexedDB||window.msIndexedDB;
Idb=Idb.open(tgsavestackerpacks,1);
Idb.onerror=function(Ev){console.log('DatabaseConnect error:',Ev);};
Idb.onsuccess=function(){if(Done)Done(Idb.result);};
Idb.onupgradeneeded=function(Store){
Store=Store.target.result;
if(Store.objectStoreNames.contains(tgsavestackerpacks))Store.deleteObjectStore(tgsavestackerpacks);
Store.createObjectStore(tgsavestackerpacks,{keyPath:'key'});
}};

function DatabaseClear(cb){
((window.indexedDB||window.mozIndexedDB||window.webkitIndexedDB||window.msIndexedDB).deleteDatabase(tgsavestackerpacks)).onsuccess=cb;
}

function DatabaseRequest(DoWrite,ErrStr,Process){
if(!DatabaseRequest.Request)DatabaseRequest.Request=function(Operation,Result){
Operation.onerror=Operation.transaction?Operation.transaction.onerror:null;
Operation.onsuccess=function(Ev){return Result(Ev.target.result);};
};
if(!DatabaseRequest.GetAll)DatabaseRequest.GetAll=function(Method,Range,Result){
var Me,Cr=false;
if(Method.getAll)Me=Method.getAll(Range);
else if(Method.mozGetAll)Me=Method.mozGetAll(Range);
else{Me=Method.openCursor(Range);Cr=true;}
Me.onerror=Me.objectStore?(Me.objectStore.transaction?Me.objectStore.transaction.onerror:null):(Me.transaction?Me.transaction.onerror:null);
if(Cr){
var Rows=[];
Me.onsuccess=function(Ev){
var Cur=Ev.target.result;
if(Cur){Rows.push(Cur.value);Cur.continue();
}else Result(Rows);
};
}else Me.onsuccess=function(Ev){Result(Ev.target.result);};
}
return DatabaseConnect(function(Db){
var Trans=Db.transaction([tgsavestackerpacks],DoWrite?'readwrite':'readonly');
Trans.onerror=function(Ev){console.log(ErrStr,' error:',Ev);};
return Process(Trans.objectStore(tgsavestackerpacks),DatabaseRequest.Request,DatabaseRequest.GetAll);
});
}

function GetByKey(Key,Result){
return DatabaseRequest(false,'GetByKey',function(Store,Request,GetAll){
if(Key!=null)return Request(Store.get(Key),Result);
return GetAll(Store,null,Result);
});
}

function PutToTable(Values,Done){
var Index=0,Max=Values.length;
if(Index>=Max)return Done?Done():null;
return DatabaseRequest(true,'PutToTable',function(Store,Request,GetAll){
var Next=function(){
if(Index>=Max)return Done?Done():null;
return Request(Store.put(Values[Index++]),Next);
};
return Next();
});
}

function main(){
log_init();
db_init(function(){
log_data('Your bot token: <input type="text" id="yourtgbottoken" name="yourtgbottoken"/> <input type="button" id="botstart" value="Start!"/>');
document.getElementById('botstart').onclick=function(){

token=document.getElementById('yourtgbottoken').value;
host='https://api.telegram.org/';
botapi=host+'bot'+token+'/';
fileapi=host+'file/bot'+token+'/';

Call('getMe',{},function(d){
log_write('Connection OK');
log_data('Bot: <b>@'+d.username+'</b> / <xmp>'+d.first_name+'</xmp>');
_bot_=d.username;

return StikerLoop(function(msg,cb){
var i=msg.length;

var next=function(){
document.title='Ready';
if(--i<0)return cb();
var stk=msg[i].sticker;
var chat=msg[i].chat.id;

Reply('Processing...',msg[i].message_id,chat,function(){

if(stk.set_name){
log_write('Stickerpack: '+stk.set_name);
Call('getStickerSet',{name:stk.set_name},function(stks){
var all=stks.stickers;
var j=all.length;
var pack=[];
var end=function(){

zipfiles(pack,function(z){
var zipname=stks.title.replace(/[^a-zA-Z0-9_=+,.() [\]@#!;%$~-]/g,'_')+'.zip';
Status('Zipped to `'+zipname+'` !',function(){

return db_put(z,zipname,next);

});
});
}
var n=function(){
if(--j<0)return end();
var stick=all[j];
DownloadMedia(stick.file_id,function(blob){

log_write('Downloaded: '+stick.file_id);
return Status('Stickers to convert: '+j,function(){
return webp2png(blob,function(png){
if(png){
log_write('Convert OK');
pack.push([stick.file_id+'.png',png],[stick.file_id+'.webp',blob]);
}else {
log_write('Convert FAIL');
pack.push(['_err_'+stick.file_id+'.webp',blob]);
}
return setTimeout(n,0);
});
});
});
}
log_write('Stickers: '+j);
Status('Stickerset found: ['+stk.set_name+'](https://t.me/addstickers/'+stk.set_name+')...',function(){setTimeout(n,1000);});
});
}else{
log_write('Lone sticker: '+stk.file_id);
DownloadMedia(stk.file_id,function(blob){
log_write('Downloaded');
Status('Sticker downloaded...',function(){
return webp2png(blob,function(png){
if(png){
log_write('Convert OK');
Status('Image converted...',function(){
zipfiles([[stk.file_id+'.png',png],[stk.file_id+'.webp',blob]],function(z){
var zipname=(stk.file_id+'.zip');
log_write('Zip done: "'+zipname+'"');
Status('Zipped to `'+zipname+'` !',function(){
return db_put(z,zipname,next);
});
});
});
}else{
log_write('Convert FAIL');
Status('Convert error...',function(){
zipfiles([['_err_'+stk.file_id+'.webp',blob]],function(z){
var zipname=(stk.file_id+'.zip');
log_write('Zip done: "'+zipname+'" (err)');
Status('Zipped to `'+zipname+'` (err) !',function(){
return db_put(z,zipname,next);
});
});
return next();
});
}
});
});
});
}

});

};
next();

});
});

}
});
};
main();
},1000);

